import React from "react";
import "./styles/Button.css";

function Button({ type, variant, className, id, onClick, children }) {
  return (
    <button
      style={{ backgroundColor: color }}
      className={variant}
      onClick={onClick}
    >
      {children}
    </button>
  );
}

export default Button;
